                margin-bottom: 550px;
            }
        }
        &__body {
            font-family: Roboto;
            font-style: normal;
            font-weight: normal;
            font-size: 18px;
            line-height: 136%;
        }
    }
    
}
.footer{
    background: #268719;
    .container {
        display: flex;
        justify-content: center;
        align-items: center;
        font-size: 15px;
        line-height: 150%;
        padding-top: 75px;
        padding-bottom: 56px;
        color: #fff;
        a{
            color: #fff;
        }
    }
    
}
.summary {
    overflow: hidden;
    position: relative;
    &__decor-1 {
        position: absolute;
        left: 0;
        top: 150px;
        @media screen and (max-width: 1200px){
            object-fit: contain;
            object-position: center;
            width: 800px;
            top: 100px;
            left: -50px;
        }
        @media screen and (max-width: 768px){
            width: 500px;
            top: 150px;
        }
        @media screen and (max-width: 568px){
            width: 500px;
            top: 80px;
        }
    }
    &__decor-2 {
        position: absolute;
        right: -550px;
        bottom: -100px;
        @media screen and (max-width: 1200px){
            right: -300px;
        }
        @media screen and (max-width: 768px){
            object-fit: contain;
            object-position: center;
            width: 1200px;
            right: -350px;
        }
        @media screen and (max-width: 480px){
            width: 1200px;
            right: -450px;
        }
    }
    &__title {
        padding: 50px;
        padding-left: 30vw;
        position: absolute;
        top: 0;
        left: -30vw;
        border-radius: 0 100px 100px 0;
        background: $main-gradient;
        font-weight: bold;
        font-size: 42px;
        line-height: 120%;
        text-transform: uppercase;
        color: #fff;
        @media screen and (max-width: 1200px){
            font-size: 34px;
        }
        @media screen and (max-width: 768px){
            font-size: 24px;
        }
        @media screen and (max-width: 568px){
            font-size: 22px;
            padding: 25px;
            padding-left: 30vw;
        }
    }
    &__product {
        margin-right: 40px;
        margin-bottom: -200px;
        @media screen and (max-width: 1200px){
            margin-bottom: -40px;
            margin-right: 0;
        }
        .inner{
            display: flex;
            flex-direction: row;
            position: relative;
        }
        
    }
    .product{
        margin-top: -70px;
        display: grid;
        grid-template: auto / 480px auto ;
        @media screen and (max-width: 1200px){
            grid-template: repeat(3, auto) / 100%;
            margin-top: 100px;
        }
        &__awards {
            grid-column-start: 1;
            grid-column-end: 2;
            grid-row-start: 1;
            grid-row-end: 2;
        }
        &__image {
            width: 350px;
            object-position: center;
            object-fit: contain;
            @media screen and (max-width: 480px){
                width: 270px;
            }
        }
        &__decor-1 {
            position: absolute;
            right: 10px;
            bottom: -20px;
            @media screen and (max-width: 1200px){
                bottom: 100px;
                right: -40px;
            }
            @media screen and (max-width: 768px){
                margin-bottom: 10px;
            }
            @media screen and (max-width: 568px){
                margin-top: 150px;
            }
            @media screen and (max-width: 480px){
                bottom: -70px;
            }
        }
        .inner{
            grid-column-start: 1;
            grid-column-end: 2;
            grid-row-start: 2;
            grid-row-end: 3;
            margin-right: -20px;
            @media screen and (max-width: 1200px){
                grid-column-start: 1;
                grid-column-end: 2;
                grid-row-start: 3;
                grid-row-end: 4;
                margin-right: 0;
            }
            @media screen and (max-width: 576px){
                grid-column-start: 1;
                grid-column-end: 2;
                grid-row-start: 2;
                grid-row-end: 3;
            }
        }
        &__advantages {

            margin-left: -50px;
            grid-column-start: 2;
            grid-column-end: 3;
            grid-row-start: 1;
            grid-row-end: 3;
            @media screen and (max-width: 1200px){
                grid-column-start: 1;
                grid-column-end: 2;
                grid-row-start: 2;
                grid-row-end: 3;
                margin-left: 0;
                display: flex;
                justify-content: space-between;
                align-items: baseline;
            }
            @media screen and (max-width: 576px){
                grid-column-start: 1;
                grid-column-end: 2;
                grid-row-start: 3;
                grid-row-end: 4;
                margin-top: 50px;
            }
            @media screen and (max-width: 480px){
                flex-wrap: wrap;
                align-items: center;
                justify-content: center;
            }
        }
    }
    .awards {
        margin-bottom: 27px;
        @media screen and (max-width: 1200px){
            justify-content: space-between;
        }
        @media screen and (max-width: 576px){
            justify-content: center;
            &__item{
                &:not(:last-child){
                    margin-right: 15px;
                }
                .award__img{
                    width: 60px;
                }
            }
        }
    }
    .advantage {
        display: flex;
        flex-direction: column;
        text-align: center;
        justify-content: center;
        align-items: center;
        &:not(:last-child){
            margin-bottom: 20px;
        }
        @media screen and (max-width: 576px){
            margin-bottom: 0;
        }
        &__image {
            width: 50px;
            height: 50px;
            object-fit: contain;
            object-position: center;
            background: $orange-gradient;
            border-radius: 50%;
            padding: 10px;
        }
        &__title {
            width: 160px;
            font-family: 'Oswald';
            font-weight: bold;
            font-size: 16px;
            line-height: 120%;
            margin-top: 5px;
            @media screen and (max-width: 576px){
                width: 150px;
            }
            @media screen and (max-width: 480px){
                width: 120px;
                margin: 10px;
            }
        }
    }
    
    &__form{
        margin-right: 170px;
        @media screen and (max-width: 1200px){
            margin-right: 0;
            align-self: flex-start;
        }
        @media screen and (max-width: 768px){
            margin-bottom: 10px;
        }
        @media screen and (max-width: 568px){
            margin-top: 150px;
        }
    }
    .container {
        padding-top: 200px;
        @media screen and (max-width: 568px){
            padding-top: 100px;
        }
    }
    .wrapper {
        z-index: 1;
        display: flex;
        justify-content: space-between;
        align-items: center;
        @media screen and (max-width: 1200px){
            flex-direction: column;
        }
    }
    
}
